    const renderSuggestions = () => {
        const suggestions = []

        Pokemons.forEach(pokemon => {
            if(pokemon.includes(text.toLowerCase())){
                [...suggestions, { pokemon: 'pokedex' }]
            }
        })

        Berries.forEach(berry => {
            if(berry.includes(text.toLowerCase())){
                [...suggestions, { berry: 'berries' }]
            }
        })

        console.log(suggestions)
        return null
        // return filteredSuggestions.map((data, i) => <li key={i} onClick={() => autoComplete(data)}>{data}</li>)
    }
    // const render = text ? renderSuggestions() : null


    return (
        <ul>
            {renderSuggestions()}
        </ul>
    )
}

